```json
{
  "application": "MATLAB",
  "details": {
    "version": "2018b",
    "resources": {
      "nodes": 1,
      "tasks_per_node": 1,
      "cpus_per_task": 1,
      "time": "2:00:00",
      "memory": "2GB",
      "job_name": "myTest",
      "mail_type": "END",
      "mail_user": "hhs4@nyu.edu",
      "output_directory": "slurm-output"
    },
    "libraries": [
      "AISP"
    ],
    "environment_variables": {
      "MATLABPATH": "$HOME/matlab-output"
    }
  }
}
```

This script runs a MATLAB application. The script uses the SLURM workload manager to run the job on a cluster, requesting one node, one task per node, one CPU per task, a runtime of 2 hours, 2GB of memory, and a job name of "myTest." The script also sets up email notifications for job completion and directs output to the "slurm-output" directory. 

The script loads the "matlab/2018b" module and sets the MATLABPATH environment variable. It then uses a "here document" to send a MATLAB script to the `matlab -nodisplay` command, which runs MATLAB in non-interactive mode. 

The MATLAB script uses the `SLURM_ARRAY_TASK_ID` and `SLURM_JOB_ID` environment variables to create a unique directory within the scratch space and runs a function called "cluster_fcn" from the AISP library. The script then deletes the directory after the function completes.
